import { Box, TextField } from "@mui/material";
import React from "react";

const CreateContact = () => {
  return (
    <Box
      sx={{
        width: "100%",
        height: "90vh",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        alignContent: "center",
        border: 1,
        borderColor: "lightgrey",
        overflowX: "hidden",
      }}
    >
      <Box
        sx={{
          width: "70%",
          height: "80vh",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          alignContent: "center",
          border: 1,
          borderColor: "lightgrey",
        }}
      >
        <Box component={"form"} sx={{ width: "80%" }}>
          <Box
            sx={{
              display: "flex",
              direction: "row",
            }}
          >
            <TextField
              name="firstName"
              label={"FirstName"}
              variant={"outlined"}
              sx={{ width: "100%", mr : 2 }}
            />
            <TextField
              name="lastName"
              label={"LastName"}
              variant={"outlined"}
              sx={{ width: "100%" }}
            />
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default CreateContact;
